import{_ as t,o as r,c as n,z as e,a as o}from"./chunks/framework.9482e208.js";const x=JSON.parse('{"title":"§ 15.2-5212 Property of commission exempt from foreclosure or execution sale and judgment lien.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/15.2-5212.md","filePath":"vacode/15.2-5212.md"}'),i={name:"vacode/15.2-5212.md"},s=e("h1",{id:"§-15-2-5212-property-of-commission-exempt-from-foreclosure-or-execution-sale-and-judgment-lien",tabindex:"-1"},[o("§ 15.2-5212 Property of commission exempt from foreclosure or execution sale and judgment lien. "),e("a",{class:"header-anchor",href:"#§-15-2-5212-property-of-commission-exempt-from-foreclosure-or-execution-sale-and-judgment-lien","aria-label":'Permalink to "§ 15.2-5212 Property of commission exempt from foreclosure or execution sale and judgment lien."'},"​")],-1),a=e("p",null,"No interest of the commission in any property, real or personal, shall be subject to sale by foreclosure of a mortgage, trust indenture, or any other instrument, either through judicial proceedings or the exercise of a power of sale contained in the instrument. All commission property shall be exempt from levy and sale by virtue of an execution, and no execution or judicial process shall issue against the commission. No judgment against the commission shall be a charge or lien upon its property, real or personal.",-1),c=e("p",null,"Nothing contained in this section shall prohibit the owner of a leasehold interest granted by the commission from granting a lien or other security interest in his leasehold which would be subject to sale or foreclosure as provided in any instrument creating the lien or other security interest. Nothing contained in this section shall prohibit the commission from granting a lien on, or creating a security interest in, commission property, real or personal, to secure any bonds issued under this chapter, any of which property will be subject to sale or foreclosure as provided in the instrument granting such lien or creating such security interest.",-1),l=e("p",null,[o("Code 1950, § 32-286; 1975, c. 295, § 15.1-1526; 1979, c. 719; 1994, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0759",target:"_blank",rel:"noreferrer"},"759"),o("; 1997, c. 587.")],-1),m=[s,a,c,l];function d(h,u,p,f,g,_){return r(),n("div",null,m)}const b=t(i,[["render",d]]);export{x as __pageData,b as default};
